import React from "react";
import './features.css'; // Import the CSS file

export const Features = (props) => {
  return (
    <div id="features">
      <div className="container">
        <div className="section-title text-center">
          <h2>Our Features</h2>
        </div>
        <div className="row">
          {/* Feature 1 */}
          <div className="col-md-3 col-xs-6">
            <div className="feature-item">
              <i className="fa fa-cogs"></i> {/* Example icon */}
              <h3>Feature One</h3>
              <p>{props.feature1 ? props.feature1 : "Feature 1 description..."}</p>
            </div>
          </div>

          {/* Feature 2 */}
          <div className="col-md-3 col-xs-6">
            <div className="feature-item">
              <i className="fa fa-laptop"></i> {/* Example icon */}
              <h3>Feature Two</h3>
              <p>{props.feature2 ? props.feature2 : "Feature 2 description..."}</p>
            </div>
          </div>

          {/* Feature 3 */}
          <div className="col-md-3 col-xs-6">
            <div className="feature-item">
              <i className="fa fa-users"></i> {/* Example icon */}
              <h3>Feature Three</h3>
              <p>{props.feature3 ? props.feature3 : "Feature 3 description..."}</p>
            </div>
          </div>

          {/* Feature 4 */}
          <div className="col-md-3 col-xs-6">
            <div className="feature-item">
              <i className="fa fa-cloud"></i> {/* Example icon */}
              <h3>Feature Four</h3>
              <p>{props.feature4 ? props.feature4 : "Feature 4 description..."}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
